"use strict";(self.webpackChunkreact_pakistan_docs=self.webpackChunkreact_pakistan_docs||[]).push([[7192],{95881:function(t){t.exports=JSON.parse('{"blogPosts":[{"id":"storybook-sitemap","metadata":{"permalink":"/react-pakistan-docs/blog/storybook-sitemap","editUrl":"https://github.com/react-pakistan/react-pakistan-docs/edit/master/blog/blog/2020-11-20-storybook-sitemap.md","source":"@site/blog/2020-11-20-storybook-sitemap.md","title":"Storybook Sitemap","description":"The Problem","date":"2020-11-20T00:00:00.000Z","formattedDate":"November 20, 2020","tags":[{"label":"storybook","permalink":"/react-pakistan-docs/blog/tags/storybook"},{"label":"sitemap","permalink":"/react-pakistan-docs/blog/tags/sitemap"},{"label":"generator","permalink":"/react-pakistan-docs/blog/tags/generator"}],"readingTime":1.34,"truncated":false,"authors":[{"name":"Taimoor Khan","title":"Core Engineering @ ReactPakistan","url":"https://github.com/Taimoormk","imageURL":"https://avatars0.githubusercontent.com/u/27800340?s=150&v=4"}],"nextItem":{"title":"Welcome","permalink":"/react-pakistan-docs/blog/welcome"}},"content":"### The Problem\\nWhile working with one of the React Pakistan Storybook based projects, I soon came\\nto realise that, there isn\'t any clean way to auto generate storybook app\\nsitemap which helps Search Engine Crawler to crawl all available pages.\\n\\n### The Solution\\nDue to the fact that storybook app urls are dynamically generated from all the stories file,\\nit makes rather cumbersome to manage auto generated list of storybook app urls.\\n\\n:::note\\n  To get started with this solution you must have installed storybook cli globally,\\n  to do so run `npm install -g sb`.\\n:::\\n\\nNow, we are going to build `stories.json` file, that has all the meta information of\\nall the stories our storybook has, which will help us to create sitemap for the app.\\n\\n- In order to do so, we are going to run `yarn build:storybook && sb extract ./.out`.\\n- The command `yarn build:storybook` resolves into `build-storybook -c .storybook -o .out`, that will generate the static storybook app and emit it into `.out` folder on the project root.\\n- The second command `sb extract ./.out`, will iterate over the static built storybook app in `.out` folder and generate `stories.json` file in the same folder i.e. `.out`.\\n- This will result in generation of `stories.json` file in `.out` folder, which will look like as following:\\n```json\\n  {\\n    \\"v\\": 2,\\n    \\"globalParameters\\": {},\\n      \\"kindParameters\\": {\\n      \\"1. React Pakistan / Intro\\": {\\n        \\"fileName\\": 621,\\n        \\"framework\\": \\"react\\"\\n      },\\n    },\\n    \\"stories\\": {\\n      \\"1-react-pakistan-intro--page\\": {\\n        \\"id\\": \\"1-react-pakistan-intro--page\\",\\n        \\"name\\": \\"Page\\",\\n        \\"kind\\": \\"1. React Pakistan / Intro\\",\\n        \\"story\\": \\"Page\\",\\n        \\"parameters\\": {\\n          \\"docsOnly\\": true,\\n          \\"__id\\": \\"1-react-pakistan-intro--page\\",\\n          \\"__isArgsStory\\": false\\n        }\\n      },\\n    },\\n  }\\n```"},{"id":"welcome","metadata":{"permalink":"/react-pakistan-docs/blog/welcome","editUrl":"https://github.com/react-pakistan/react-pakistan-docs/edit/master/blog/blog/2020-11-16-welcome.md","source":"@site/blog/2020-11-16-welcome.md","title":"Welcome","description":"We Welcome you at React Pakistan Docs","date":"2020-11-16T00:00:00.000Z","formattedDate":"November 16, 2020","tags":[{"label":"react","permalink":"/react-pakistan-docs/blog/tags/react"},{"label":"pakistan","permalink":"/react-pakistan-docs/blog/tags/pakistan"},{"label":"welcome","permalink":"/react-pakistan-docs/blog/tags/welcome"},{"label":"documentation","permalink":"/react-pakistan-docs/blog/tags/documentation"}],"readingTime":0.855,"truncated":false,"authors":[{"name":"Taimoor Khan","title":"Core Engineering @ ReactPakistan","url":"https://github.com/Taimoormk","imageURL":"https://avatars0.githubusercontent.com/u/27800340?s=150&v=4"}],"prevItem":{"title":"Storybook Sitemap","permalink":"/react-pakistan-docs/blog/storybook-sitemap"}},"content":"### We Welcome you at React Pakistan Docs\\nThank you for making this far to be `here`. It means a lot for us, hope you will\\nenjoy using `React Pakistan` packages and also will get all the relevant docs that you\\nneed for your successful project development.\\n\\n### The Bigger Picture\\nOur projects are distributed into three major categories:\\n  - ReactJS\\n  - React Native\\n  - Utils\\n\\n### Tech Stack\\nOur preferred technologies used for these projects are as follows:\\n  - ReactJS\\n  - React Native\\n  - TypeScript\\n  - StyledComponents\\n  - Storybook\\n  - Jest\\n  - ESlint\\n  - CSS Grid\\n  - GitHub CI\\n\\n### List of all Published Projects\\n  - React Commons Collection\\n  - React UI Collection\\n  - React Icon Collection\\n  - React Logo Collection\\n  - React Emoji Collection\\n  - React Native Commons Collection\\n  - React Native UI Collection\\n  - React Native Icon Collection\\n  - React Native Logo Collection\\n  - React Native Emoji Collection\\n  - React Native Boilerplate\\n  - Util Functions\\n  - Util React Native Functions\\n  - Eslint Shared Config\\n  - React Pakistan Docs"}]}')}}]);